def get_prime_numbers(n, limit=51):

    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(num ** 0.5) + 1):
            if num % i == 0:
                return False
        return True

    def sieve_prime_numbers(n):
        primes = [True] * (n + 1)
        primes[0] = primes[1] = False
        p = 2
        while p * p <= n:
            if primes[p]:
                for i in range(p * p, n + 1, p):
                    primes[i] = False
            p += 1
        return [i for i in range(n + 1) if primes[i]]
    if not is_prime(n):
        return "Input 'n' is not a prime number."
    primes = sieve_prime_numbers(limit)
    return [prime for prime in primes if '5' not in str(prime) and str(prime) != str(prime)[::-1]]

